import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { FiUser, FiImage, FiHardDrive, FiClock, FiLogOut, FiUpload, FiEye, FiBarChart2, FiSettings, FiActivity, FiHeart, FiInfo } from 'react-icons/fi';

const AdminPage = () => {
  const [user, setUser] = useState(null);
  const [images, setImages] = useState([]);
  const [loading, setLoading] = useState(true);
  const [dashboardData, setDashboardData] = useState({
    totalPhotos: 0,
    storageUsed: '0 MB',
    lastUpload: 'Never',
    totalViews: 0,
    totalLikes: 0
  });

  useEffect(() => {
    // Get user info and images
    const fetchData = async () => {
      try {
        const userResponse = await axios.get('/auth/me');
        setUser(userResponse.data);

        const imagesResponse = await axios.get('/images');
        setImages(imagesResponse.data);

        // Calculate dashboard stats
        calculateDashboardStats(imagesResponse.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  const calculateDashboardStats = (images) => {
    // Calculate total photos
    const totalPhotos = images.length;

    // Calculate storage used (approximate)
    const totalSize = images.reduce((sum, image) => sum + image.size, 0);
    const storageUsed = formatBytes(totalSize);

    // Calculate last upload
    let lastUpload = 'Never';
    if (images.length > 0) {
      const latestImage = images.reduce((latest, image) => 
        new Date(image.created_at || image.createdAt) > new Date(latest.created_at || latest.createdAt) ? image : latest, images[0]
      );
      lastUpload = new Date(latestImage.created_at || latestImage.createdAt).toLocaleDateString();
    }

    // Calculate total views and likes (simulated)
    const totalViews = Math.floor(images.length * 25); // Simulated view count
    const totalLikes = Math.floor(images.length * 3.5); // Simulated like count

    setDashboardData({
      totalPhotos,
      storageUsed,
      lastUpload,
      totalViews,
      totalLikes
    });
  };

  const formatBytes = (bytes, decimals = 2) => {
    if (bytes === 0) return '0 Bytes';
    const k = 1024;
    const dm = decimals < 0 ? 0 : decimals;
    const sizes = ['Bytes', 'KB', 'MB', 'GB'];
    const i = Math.floor(Math.log(bytes) / Math.log(k));
    return parseFloat((bytes / Math.pow(k, i)).toFixed(dm)) + ' ' + sizes[i];
  };

  const handleLogout = () => {
    localStorage.removeItem('token');
    delete axios.defaults.headers.common['Authorization'];
    window.location.href = '/login';
  };

  if (loading) {
    return (
      <div className="min-h-screen flex items-center justify-center bg-[#FFF5E1]">
        <div className="text-center">
          <div className="w-16 h-16 border-4 border-[#FF6F61] border-t-transparent rounded-full animate-spin mx-auto mb-4"></div>
          <div className="text-[#001F3F] text-xl font-light">Loading dashboard...</div>
          <p className="text-[#001F3F]/70">Preparing your admin experience</p>
        </div>
      </div>
    );
  }

  return (
    <>
      <div className="gallery-header">
        <h1 className="text-3xl">Admin Dashboard</h1>
        <p className="text-[#001F3F]/80">Manage your photography portfolio</p>
        <div className="flex items-center gap-6 mt-4 flex-wrap justify-center">
          <div className="flex items-center gap-2 text-[#001F3F]">
            <FiUser className="text-[#A8E6CF]" />
            <span>Logged in as: <span className="font-medium">{user?.username}</span></span>
          </div>
          <Link
            to="/"
            className="flex items-center gap-2 text-[#A8E6CF] hover:text-[#7fc9ae] transition-colors"
          >
            <FiEye /> View Public Gallery
          </Link>
          <button
            onClick={handleLogout}
            className="flex items-center gap-2 text-[#FF6F61] hover:text-[#e56259] transition-colors"
          >
            <FiLogOut /> Logout
          </button>
        </div>
      </div>

      <div className="px-4 md:px-8">
        <div className="max-w-7xl mx-auto py-8">
          {/* Stats Cards */}
          <div className="grid grid-cols-2 md:grid-cols-4 gap-6 mb-10">
            <div className="bg-white/80 backdrop-blur-sm rounded-2xl p-6 border border-[#708090]/30 shadow-sm hover:shadow-md transition-shadow">
              <div className="flex items-center gap-3">
                <div className="w-12 h-12 rounded-xl bg-gradient-to-br from-[#FF6F61] to-[#A8E6CF] flex items-center justify-center">
                  <FiImage className="text-white text-xl" />
                </div>
                <div>
                  <p className="text-[#001F3F]/70 text-sm">Total Photos</p>
                  <p className="text-2xl font-bold text-[#001F3F]">{dashboardData.totalPhotos}</p>
                </div>
              </div>
            </div>

            <div className="bg-white/80 backdrop-blur-sm rounded-2xl p-6 border border-[#708090]/30 shadow-sm hover:shadow-md transition-shadow">
              <div className="flex items-center gap-3">
                <div className="w-12 h-12 rounded-xl bg-gradient-to-br from-[#A8E6CF] to-[#7fc9ae] flex items-center justify-center">
                  <FiHardDrive className="text-white text-xl" />
                </div>
                <div>
                  <p className="text-[#001F3F]/70 text-sm">Storage Used</p>
                  <p className="text-2xl font-bold text-[#001F3F]">{dashboardData.storageUsed}</p>
                </div>
              </div>
            </div>

            <div className="bg-white/80 backdrop-blur-sm rounded-2xl p-6 border border-[#708090]/30 shadow-sm hover:shadow-md transition-shadow">
              <div className="flex items-center gap-3">
                <div className="w-12 h-12 rounded-xl bg-gradient-to-br from-[#708090] to-[#5c6b7a] flex items-center justify-center">
                  <FiEye className="text-white text-xl" />
                </div>
                <div>
                  <p className="text-[#001F3F]/70 text-sm">Total Views</p>
                  <p className="text-2xl font-bold text-[#001F3F]">{dashboardData.totalViews}</p>
                </div>
              </div>
            </div>

            <div className="bg-white/80 backdrop-blur-sm rounded-2xl p-6 border border-[#708090]/30 shadow-sm hover:shadow-md transition-shadow">
              <div className="flex items-center gap-3">
                <div className="w-12 h-12 rounded-xl bg-gradient-to-br from-[#A8E6CF] to-[#7fc9ae] flex items-center justify-center">
                  <FiHeart className="text-white text-xl" />
                </div>
                <div>
                  <p className="text-[#001F3F]/70 text-sm">Total Likes</p>
                  <p className="text-2xl font-bold text-[#001F3F]">{dashboardData.totalLikes}</p>
                </div>
              </div>
            </div>
          </div>

          {/* Recent Activity */}
          <div className="bg-white/80 backdrop-blur-sm rounded-2xl p-6 border border-[#708090]/30 shadow-sm mb-10">
            <div className="flex items-center gap-3 mb-6">
              <FiActivity className="text-[#001F3F] text-xl" />
              <h3 className="text-xl font-medium text-[#001F3F]">Recent Activity</h3>
            </div>
            <div className="space-y-4">
              <div className="flex items-center justify-between p-4 bg-cream-100/50 rounded-xl">
                <div className="flex items-center gap-3">
                  <div className="w-10 h-10 rounded-full bg-[#FF6F61]/20 flex items-center justify-center">
                    <FiImage className="text-[#FF6F61]" />
                  </div>
                  <div>
                    <p className="font-medium text-[#001F3F]">New photo uploaded</p>
                    <p className="text-sm text-[#001F3F]/70">Sunset at the beach</p>
                  </div>
                </div>
                <span className="text-sm text-[#001F3F]/70">2 hours ago</span>
              </div>
              <div className="flex items-center justify-between p-4 bg-cream-100/50 rounded-xl">
                <div className="flex items-center gap-3">
                  <div className="w-10 h-10 rounded-full bg-[#A8E6CF]/20 flex items-center justify-center">
                    <FiHeart className="text-[#A8E6CF]" />
                  </div>
                  <div>
                    <p className="font-medium text-[#001F3F]">Photo reached 100 likes</p>
                    <p className="text-sm text-[#001F3F]/70">Mountain landscape</p>
                  </div>
                </div>
                <span className="text-sm text-[#001F3F]/70">1 day ago</span>
              </div>
              <div className="flex items-center justify-between p-4 bg-cream-100/50 rounded-xl">
                <div className="flex items-center gap-3">
                  <div className="w-10 h-10 rounded-full bg-[#708090]/20 flex items-center justify-center">
                    <FiInfo className="text-[#708090]" />
                  </div>
                  <div>
                    <p className="font-medium text-[#001F3F]">New comment received</p>
                    <p className="text-sm text-[#001F3F]/70">On your portrait series</p>
                  </div>
                </div>
                <span className="text-sm text-[#001F3F]/70">3 days ago</span>
              </div>
            </div>
          </div>

          {/* Quick Actions */}
          <div className="bg-white/80 backdrop-blur-sm rounded-2xl p-6 border border-[#708090]/30 shadow-sm">
            <div className="flex items-center gap-3 mb-6">
              <FiSettings className="text-[#001F3F] text-xl" />
              <h3 className="text-xl font-medium text-[#001F3F]">Quick Actions</h3>
            </div>
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
              <Link
                to="/admin/upload"
                className="bg-gradient-to-r from-[#FF6F61] to-[#FF8533] hover:from-[#e56259] hover:to-[#ff7a26] text-white p-5 rounded-xl flex flex-col items-center justify-center transition-all duration-300 transform hover:-translate-y-0.5 shadow-md hover:shadow-lg"
              >
                <FiUpload className="text-2xl mb-2" />
                <span className="font-medium">Upload Photos</span>
              </Link>
              <Link
                to="/"
                className="bg-white/70 hover:bg-white text-[#001F3F] border border-[#708090]/50 p-5 rounded-xl flex flex-col items-center justify-center transition-all duration-300 transform hover:-translate-y-0.5 shadow-sm hover:shadow-md"
              >
                <FiEye className="text-2xl mb-2" />
                <span className="font-medium">View Gallery</span>
              </Link>
              <Link
                to="/"
                className="bg-white/70 hover:bg-white text-[#001F3F] border border-[#708090]/50 p-5 rounded-xl flex flex-col items-center justify-center transition-all duration-300 transform hover:-translate-y-0.5 shadow-sm hover:shadow-md"
              >
                <FiBarChart2 className="text-2xl mb-2" />
                <span className="font-medium">View Stats</span>
              </Link>
              <Link
                to="/"
                className="bg-white/70 hover:bg-white text-[#001F3F] border border-[#708090]/50 p-5 rounded-xl flex flex-col items-center justify-center transition-all duration-300 transform hover:-translate-y-0.5 shadow-sm hover:shadow-md"
              >
                <FiSettings className="text-2xl mb-2" />
                <span className="font-medium">Settings</span>
              </Link>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default AdminPage;
